import React, {useState} from 'react';

function Button(){
    const [count, setCount] = useState(0);
    const handleClick = (x) => {
        setCount();
    }
    return(
        <div>
            <p>{count}</p>
            <button onClick = {handleClick}>Increment</button>
        </div>
    );
}

export default Button;
